import React from 'react'
import {Stack, Typography} from "@mui/material";

function Headline() {
    return (
        <Typography
            variant="h2"
        >
            social media, for clubs
        </Typography>
    )
}

export default function PromoText() {
    return (
        <Stack>
            <Headline />
        </Stack>
    )
}
